<p>我是王若伊晗。是这个博客的主人，你也可以叫我蝶梦，这个名字来源于一首诗中的哲学典故----“庄生晓梦迷蝴蝶，望帝春心托杜鹃”  庄周梦见自己便成了蝴蝶，从喧嚣的人生走向逍遥之境，而梦醒发现自己还是庄子。他说当梦足够真实，人没有任何能力知道自己是否是在做梦，那我们呢？我们是否能分清现实和梦境呢？综上，我给自己起了一个富有浪漫主义色彩的笔名——“蝶梦”。</p>
